import React, { Component} from 'react';
import { Col, Row,} from 'reactstrap';


class Notas extends Component {
  render() {
    return (
        <Row>
            <Col xs="12" md="12">
                <Row>
                    <Col xs="12" md="12" ClassName="notas-stl">
                        <h4>Titulo uno</h4>
                        <p>Ullamco nostrud sit reprehenderit ex exercitation deserunt ex excepteur esse.</p>
                    </Col> 
                </Row>
                <Row>
                    <Col xs="12" md="12">
                        <h4>Titulo uno</h4>
                        <p>Ullamco nostrud sit reprehenderit ex exercitation deserunt ex excepteur esse.</p>
                    </Col> 
                </Row>
                <Row>
                    <Col xs="12" md="12">
                        <h4>Titulo uno</h4>
                        <p>Ullamco nostrud sit reprehenderit ex exercitation deserunt ex excepteur esse.</p>
                    </Col> 
                </Row>                                
            </Col>
        </Row>
    );
  }
}

export default Notas;
